import React from 'react';
import { Link } from 'react-router-dom';
import EstrellasRating from './EstrellasRating';
import logo from './assets/OlvaCurrier.js'
import './Empresas.css';

const HostCard = () => {
  return (
    <div className="host-card">
      <div className="host-info">
        <img className="Olva" src="{logo}" alt="OlvaCurrier" />
        <div className="host-details">
          <h2>Olva Courier</h2>
          <p>Av. Andrés Aramburú 978 Lima, San Isidro</p>
          <div className="host-stats">
            <Link to="/Evaluacion">222 Evaluaciones</Link>
            <div className="rating-container">
              <Link to="/rating-pagina" className="rating-link">4,95 Valoración</Link>
              <EstrellasRating rating={4.95} />
            </div>

          </div>
        </div>
      </div>
      <div className="host-extra-info">
        <p><i className="fas fa-briefcase"></i> Trabajo: Monte Frio Alpacas</p>
        <p><i className="fas fa-language"></i> Idiomas: inglés y portugués</p>
        <p><i className="fas fa-map-marker-alt"></i> Vivo en: Aveiro, Portugal</p>
      </div>
      <p className="host-description">
      Especialistas en última milla, brindando servicios de calidad en transporte de 
      encomiendas a domicilio o a cualquiera de nuestras tiendas o agentes a nivel ...

      </p>
      <Link to="/Evaluacion" className="show-more-link">Mostrar más evaluaciones</Link>
    </div>
  );
};

export default HostCard;
